import axios from 'axios'
import { useEffect, useState } from 'react'
import styles from './App.module.scss';
import GetDataFromSoldOut from './getDataFromSoldOut';
import GetDataFromSNKRDUNK from './GetDataFromSNKRDUNK';
import Layout from './LayOut';

function App() {
  const [code, setCode] = useState('')
  const [submitCode, setSubmitCode] = useState('');

  const handleClick = () => {
    setSubmitCode(code)
  }

  return (
    <div className={styles.wrapper} style={{ minHeight: 1000 }}>
      <GetDataFromSoldOut submitCode={submitCode} />
      <GetDataFromSNKRDUNK submitCode={submitCode} />
      <input
        value={code}
        onChange={(e) => setCode(e.target.value)}
      />
      <h4></h4>

      <button onClick={handleClick}>Submit</button>
      <Layout submitCode={submitCode} />
    </div>
  );
}

export default App;
